import { NAME, ADD } from '/home/ksolves/Documents/sujeet/training/ReactJs/redux-app/src/action_type/index.js';

const update_ame = (state = [], action) => {
  console.log(action);
  switch (action.type) {
    case NAME:
      return action.payload.name;
    default:
      return state;
  }
}

const update_dd = (state = [], action) => {
  switch (action.type) {
